import { useEffect, useState } from 'react'
import './app.css'

function App() {

  const [no1 , setNo1] = new useState(0);


  return (
    <div className="App ">
      <button
        onClick={() => {
          setNo1(no1 + 1);
        }}
      >
        button 1  - {no1}
      </button>

      <button
        onClick={() => {
          setNo2(no2 + 1);
        }}
      >
        button 2 - {no2}
      </button>
    </div>
  );
}

export default App;
